import React from 'react';
import './SectionFive.css';

export default class SectionFive extends React.Component {
  render() {
    return (
      <div className='sectionfive'>
        <div className='row'>
          <h2>Frequently Asked Questions</h2>
        </div>
      </div>
    );
  }
}
